import React from 'react'

const Logo = props => {
    return (
        <div>
            <img style={styles.flavor} src="flavor.png" alt="logo"/>
            <img styly={styles.garlic} src="./components/logo/garlic.png" alt="garlic"/>
        </div>
    )
};

export default Logo

const styles = {
    flavor: {
        position: 'relative',
        padding: '0',
        margin: '0',
        width: '100%'
    },
    garlic: {

    }
};
